legacy_item_64 = {'color_name': 'Clan Construction Pamphlet', 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 64, 'key': 'Clan Construction Pamphlet', 'price': 1, 'room_description': 'A clan construction pamphlet has been dropped here', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_64', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)], 'ex_descriptions': [['look clan pamphlet', '   |yFore note: A clan hall can be up to 100 rooms in size, with any combination\r\nof the below so long as limits imposed on individual packages are not exceeded.\r\n\r\n|n\r\n\r\n|yPrice Guide - Rooms|n\r\n---------------------------------------\r\n|cBasic Clan Hall:|w 90,000 zenni. 5 rooms. (Must be purchased)|n\r\n|cTraining Area:|w 60,000 zenni per package. Adds 20 rooms populated with NPCs. (Up to 2 may be purchased)|n\r\n|cShops:|w 15,000 zenni per shop (up to a limit of three). Sells sets of clan equipment, with differing levels.|n\r\n|cClan Vault:|w 30,000 zenni. Adds one safe room where items can be dropped without fear of loss. (Max 1)|n\r\n|cPrivate Landing Pad:|w 45,000 zenni. Adds a secure landing pad to clanhall. (Max 1)|n\r\n|cRec Room:|w 30,000 zenni. Adds 5 rooms with a couple of beds and food dispenser. (Max 1)|n\r\n|cPrison:|w 30,000 zenni. Adds 5 rooms: 2 cells, 2 outer cells and 1 prison office. Existing guards become non-lethal and will arrest invaders instead of killing. (Max 1)|n\r\n|cAdditional Rooms:|w 15,000 zenni. Adds 5 rooms to clan hall.|n\r\n|cClan Bank:|w 15,000 zenni. This adds one clan bank room to the clan hall allowing use of the clan bank.|n\r\n\r\n|yPrice Guide - Extras|n\r\n---------------------------------------\r\n|cDecoration Items(including furniture):|w 2,000 zenni per item.\r\n|cAdditional Items:|w 15,000 zenni per item. Adds a non-quest store item to one of the clan shops.|n\r\n|cBank Anywhere:|w 15,000 zenni. This allows your clan members to deposit/withdraw from anywhere.|n\r\n|cPostmaster:|w 7,500 zenni. Adds a postmaster to the clan hall. (max 1)|n\r\n|cGravity Generator:|w 30,000 zenni. Adds a gravity generator to a pre-existing room. (Max 2)|n\r\n|cKey-locked door:|w 7,500 zenni. Adds a keylocked door to clan hall.|n\r\n|cPassword locked door:|w 22,500 zenni. Adds a password locked door to clan hall.|n\r\n|cInstant Transmission Proofing:|w 300,000 zenni. Protects the clan hall against IT.|n\r\n|cClan Board:|w 7,500 zenni. Adds a clan board to the hall. (Max 2)|n\r\n|cGuard Mobs:|w 7,500 zenni per Guard type. Can have up to two different guard types. (Each load a max of 6 times. Guards start at level 10).|n\r\n|cIncrease Guard mob level:|w 7,500 zenni. Increases one guard type by 5 levels.|n\r\n|cHealing Tank:|w 15,000 zenni. Adds a healing tank to the clan hall.|n\r\n|cTraining Mobs: |wClans can have up to four types of training mobs in their clan hall for free. They can be any level from 1-100. To have mobs above level 100 they must pay 250,000 zenni per level increase for a particular mob.|n\r\n']]}

