legacy_item_318 = {'color_name': 'Nexus News', 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 318, 'key': 'Nexus News', 'room_description': 'A copy of the latest nexus news has been dropped here', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_318', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)], 'ex_descriptions': [['look nexus news', '|yA special report on restaurant chain McStuffs!|n\r\nAn intergalactic powerhouse by the year 215 with locations all over the known Universe the Mcstuff food chain started with humble beginnings on the human planet known as Earth. This is the story you may not know.\r\n\r\nFounded by Macy Stoofz a 31 year old college graduate with a degree in radio communications and advertsing in the year 152 as a way to pay off her student loans (Macy had been unable to find work in her field of study due to male chauvinism of the time) She had been invited to a cousins wedding and unable to afford a present had decided to cater the event herself, using recipes she had developed in school to eat healthy, filling, meals while on an extremely tight budget.\r\n\r\nThe overall success of the event and at the urging of all present Macy decided to borrow the startup money needed from the Nexus City Bank at an exhorbitant interest rate. She chose a dilapidated residence on Evergreen Street as the start of her venture and construction was soon underway to turn the former home into a new sandwhich shop. \r\n\r\nBusiness was good and after a few years (and a few changes to the menu) Macy was forced to hire help just to keep up with demand. Her investment had payed off so well that she soon had locations in other cities on Earth and in the year 180 having invested heavily into other markets, one of which was the relatively new Capsule Corporation, the Mcstuff food chain was able to expand into space following the discovery of interplanetary travel. \r\n\r\nSadly Macy had passed away in the year 193 in her own home in Nexus before her dream of seeing A McStuff on every planet in known space but her corporation lives on under the guidance of her children and board of directors, and following her wishes continue to push for more expansion. There is now a Mcstuff on every planet in charted space with the exception of the worlds banned from trade with Humanity by the E.A.T.S (Earth Alliance of Trade and Sovereignity) the planet Frigid, Vegeta, Yardrat, and Kanass\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\na all fall into this category.\r\n\r\nThe McStuff corpation has long had a history of public service through various donations to charitable organizations and centers of learning across the worlds, and a practice of hiring without discrimination, started by Macy herself after facing such a situation when she was younger.\r\n\r\nThe current president of McStuff has said that the direction for the company has not changed from the founders original goal of having safe healthy food available to any that wish it, and if circumstances ever change with the planets barred from Earth activity menus and infrastructure for the currently hostile worlds are already under design.\r\n']]}

