legacy_item_622 = {'color_name': '|WAdvent Duel Handbook|n', 'desc': '|gAdvent Duel Collectible Card Game Handbook\r\n|r-Contents-\r\n|wPage 1: |cBasic Concepts\r\n|wPage 2: |cAnatomy of a game - setting up\r\n|wPage 3: |cAnatomy of a game - the first turn\r\n|wPage 4: |cAnatomy of a game - the process of a turn\r\n|wPage 5: |cCombat and Blocking\r\n|wPage 6: |cOther rules\r\n|wPage 7: |cElements and you\r\n|wPage 8: |cCommands\r\n\r\n|W[OOC: Use look page1, look page2, etc. to view pages]|n\r\n', 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 9]], 'item_vnum': 622, 'key': 'Advent Duel Handbook', 'room_description': "|WA small blue and black book labled 'Advent Duel Handbook' is lying here|n", 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_622', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)], 'ex_descriptions': [['Page1', '|x----------|Bv|x----------\r\n|rBasic Concepts\r\n|wThe story:\r\n   |cIn the mythical world of Parkara, sorcerers battle for control of their\r\nworld. They wage battles using spells, creatures, and items- battles whose\r\nconsequences echo throughout the ages. You are one of these sorcerers. Do you\r\nhave what it takes to conquer those who would stand against you? \r\n|wCard Types:\r\n|cThere are three basic card types, and they are as follows.\r\n|wCreatures: |CThe most common card type, these are beasts, heroes and villains\r\nsummoned to do your bidding. Many have special abilities. \r\n|wItems: |CThese are objects that generate a special effect or have a unique ability.\r\n|wSkills: |CThese are spells, enchantments, and special abilities. Unlike\r\ncreatures and items, a skill can be used at any time.\r\n'], ['Page2', '|x----------|Bv|x----------\r\n|rAnatomy of a game: Setting up\r\n|wStep 1 - |cLife: All players set their life to 100\r\n|wStep 2 - |cEnergy: All players set their energy to 7\r\n|wStep 3 - |cCheck: All players display their counters.\r\n|wStep 4 - |cShuffle: All players must shuffle their decks.\r\n|wStep 5 - |cHand: All players show their hands, to show that they are starting empty.\r\n|wStep 6 - |cDraw: All players draw 7 cards\r\n|wStep 7 - |cRoll: All players roll a pair of dice. The highest roll gets to\r\nchoose who goes first, as well as the order of play. In the event that two\r\nplayers are tied for highest, they will reroll until one rolls higher.\r\n'], ['Page3', '|x----------|Bv|x------------\r\n|rAnatomy of a Game: The first turns.\r\n|wStep 1 - |cDraw: This stage is skipped for the first player to go on their\r\nfirst turn. All others may draw a card on their first turn. \r\n|wStep 2 - |cMain: During this step, you may summon creatures or items, or use abilities.\r\n|wStep 3 - |cEnd of turn: Any effects that occur when a player ends their turn\r\ndo so now. If a player has more then 7 cards, they must discard until they\r\nhave only 7 cards.\r\n'], ['Page4', "|x----------|Bv|x----------\r\n|rAnatomy of a Game: The process of a turn.\r\n|wStep 1 - |cLife: All creatures controlled by the player are fully\r\nhealed at the beginning of their turn.\r\n|wStep 2 - |cEnergy: For every card in your hand, add 1 energy to\r\nyour counter. \r\n|wStep 3 - |cHand: You MUST use hand look, to display the number of\r\ncards in your hand to all playing.\r\n|wStep 4 - |cDraw: Draw a single card. If you do not have any cards to\r\ndraw, you are out of the game.\r\n|wStep 5 - |cMain: During this step, you may summon creatures or items,\r\nor use abilities.\r\n|wStep 6 - |cBattle: During this step, you may attack with any creatures\r\nyou control.\r\n|wStep 7 - |cEnd of Turn: any effects that occur when a player ends their\r\nturn do so now. To signify that a player is ending their turn, they\r\nshould show their counter. If you have more then 7 cards in your hand,\r\nyou must discard until you have no more then seven.\r\n|yThe endgame: |gWhen a player's life reaches 0, they are out of the game.\r\nThe last player standing is declared the winner.\r\n"], ['Page5', "|x--------|Bv|x-----------\r\n|rCombat: \r\n|cYou must declare each creature that is attacking, or attacking\r\nwith all.\r\n|cThe defending player may block with any creatures they control,\r\nor use any skill cards they possess. \r\n|cAny creatures that are not blocked deal their attack directly\r\nto a player's life.\r\n|rBlocking:\r\n|cIf a creature attacked on it's controller's turn, it may not\r\nblock.\r\n|cWhen a creature is blocked, both creatures deal their attack\r\nto the other creature's life. |cThis occurs simultaneously.\r\n"], ['Page6', '|x----------|Bv|x----------\r\n|rOther Rules\r\n|w1) |cA legal deck is 50 cards. No more, and no less.\r\n|w2) |cA player may not have more then four copies of\r\nany card in his deck.\r\n|w3) |cA creature that is reduced to 0 life dies and\r\nis immediately placed in the void.\r\n|w4) |cCards that have been nicknamed are illegal to\r\nplay.\r\n|w5) |cA maximum of 4 players is allowed in any game.\r\n|w6) |cIn a team game, turns must alternate between the\r\ntwo teams.\r\n|w7) |cA game may only be played at an official duel\r\ntable.\r\n|w8) |cAll players must have the necessary equipment.\r\n|w9) |cCreature, skill, and item abilities take effect\r\nAS they are being played.\r\n|w10) |cIf a player wishes to respond to a particular\r\ncard, you must allow it. I.e., you may not spam commands\r\nto prevent a response.\r\n|w11) |cIf a player requests a counter or hand check,\r\nyou must use counter display or hand look.\r\n'], ['Page7', '|x----------|Bv|x----------\r\n|rElements and You\r\n|wCreatures have resistances and immunities based on their element.\r\nThis does not apply to skills used by their controller.\r\n|bWater|w: +0/+1 vs |rFire|w. Immune to |rFire|w skills.\r\n|rFire|w: +1/+0 vs |cAir|w. Immune to |cAir|w skills.\r\n|cAir|w: +0/+1 vs |gEarth|w. Immune to |gEarth|w skills.\r\n|gEarth|w: +1/+0 vs |bWater|w. Immune to |bWater|w skills.\r\n'], ['Page8', '|x----------|Bv|x----------\r\n|rAdvent Duel Commands.\r\n|cShuffle\r\n|wPlay (card name)\r\n|cTable (table color) (card name)\r\n|wDraw\r\n|chand (look | show)\r\n|rCounter Commands\r\n|x------------------\r\n|wcounter (check | display)\r\n|clife (number)\r\n|wenergy (number)|n\r\n']]}

