legacy_item_8100 = {'color_name': '|wT|Whe |wB|Wetrayal|n', 'desc': "|rThe Betrayal |Rby Alextra Cavore|n\r\n\r\n   |wMany centuries ago, the first alien visitors arrived on Konack. These beings\r\nwhom would later come to be known as Truffles, who were technologically superior\r\nto the Konatsu people in every way. |n\r\n\r\n   |wThe people feared these small devils and amongst the Great Houses, only\r\nSereg-Vanma did not outlaw them. Instead, against the advice of the grand\r\ncouncil, Grand master Llaro Benim welcomed them with open arms. |n\r\n\r\n   |wBenim had watched as his house slowly began to lose its superior power to the\r\nother four under his rule. And in the Truffles, he had a way to not only\r\ncorrect this but to establish a new world order, with him its unconditional\r\nruler. |n\r\n\r\n   |wHouse Sereg-Vanma's warriors were mobilised for war, armed with Truffle\r\ntechnology. The war raged for several years with Benim having more victorious\r\nat the start of this war. The four other houses with Indoril leading the way,\r\nunited and pushed back the traitor forces. |n\r\n\r\n   |wEventually, House Sereg-Vanma and their Truffle allies were pushed back to\r\ntheir last bastion. Defeat for the traitors looked almost certain but as the\r\ncombined forces of House Indoril, Oroist, Dres and Taesal breached the\r\nstronghold, the greatest act of treachery in Konack's history was commited. |n\r\n\r\n   |wA massive beast created by perverse magic and blasphemous Truffle technology\r\nwas summoned to the battlefield. In mere minutes, the creature that had been\r\nsummoned, Hirudegan, managed to scatter the pious forces. |n\r\n\r\n   |wThe Hirudegan beast then over the course of two weeks caused untold\r\ndestruction and killed countless Konatsu warriors and innocent villagers before\r\nit was finally stopped by a warrior whose name was omitted from the history\r\nbooks. |n\r\n\r\n   |y(Historical note - It is estimated that almost more than 50 times more lives\r\nwere lost to Hirudegan's rampage than in the previous six years of the war. )|n\r\n\r\n   |wWith the death of Hirudegan, the remaining traitorous forces were easily\r\ncrushed. After this final defeat, Lord Llaro Benim was executed along with any\r\nsurviving Truffles. The House was renamed to Sereg-Vanam and placed under\r\nconstant watch from the priests and monks of House Oroist. |n\r\n", 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 8100, 'key': 'The Betrayal book', 'price': 10, 'room_description': 'A book is laying here', 'size': 4, 'weight': 4, 'prototype_key': 'legacy_item_8100', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)]}

legacy_item_8101 = {'color_name': '|yYellow |nbook of |yI|Yn|yd|xo|Yr|Yi|yl|n', 'desc': 'This book is an information guide on House Indoril.\r\n\r\n|wNotable Figures|n\r\n|W-----------------|n\r\n   |wHighborne Sappherion - Current Leader of House Indoril and ruler of Konack.\r\nLongest reigning Highborne in over 200 years. He can be located at the Emerald\r\nTower. |n\r\n\r\n   |wCouncillor Marias - A member of the Council of Kal Tyor and also the highest\r\nranking Indoril member behind Sappherion. She is in charge of the day-to-day\r\nrunning of the House and can be found in the Indoril Compound in Tiranoc. |n\r\n\r\n|wCapital|n\r\n|W-----------------|n\r\n   |wThe capital of the House Indoril region is Tiranoc, the largest city on\r\nKonack. The primary holdings here is the Indoril compound in the pontius\r\nsector. |n\r\n\r\n|wGuards|n\r\n|W-----------------|n\r\n   |wAlmost every House maintains their own guards but those of House Indoril are\r\namongst the finest Konatsu Warriors available. The ordinators (of which there\r\nare several ranks) are the soldiers of House Indoril and the guards of Tiranoc.\r\nThe ordinators are also personally responsible with defending the Emerald Tower,\r\nthe home of the Highborne and the Kal Tyor. |n\r\n\r\n|wHistoric Figures|n\r\n|W-----------------|n\r\n   |wThe chief historical figure of House Indoril is a hero known as Eltharion. \r\nHe was one of the finest swordsmen of the War of Betrayal era. However, he was\r\ncompletely blind and the only house that would take him into service was House\r\nIndoril. It was said that using his honed hearing, he could see more clearly\r\nthan he ever could when his eyesight was still intact. Eltharion is one of the\r\nonly men to ever thwart an assassination attempt by Meridius. |n\r\n', 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 8101, 'key': 'Yellow Book of Indoril', 'price': 10, 'room_description': 'A copy of the Yellow Book of Indoril has been dropped here', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_8101', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)]}

legacy_item_8102 = {'color_name': '|bBlue|n book of |bO|Br|Wo|wi|Bs|bt|n', 'desc': "This book is an information guide on House Oroist\r\n\r\n|wHouse Oroist|n\r\n|W------------------|n\r\n   |wOroist is the least traditional house in the sense that is the representation\r\nof the monks and clergymen of the primary religion on Konack, the worship of a\r\ngod known as Temujin. Fable tells that Temujin appears one day and slew the\r\nancester god Shigeru for being deceiptful and cruel to those he was charged\r\nwith. Oroist is the youngest house and they claim their origins lay in those\r\nfew who witnessed Temujin slay Shigeru first hand. |n\r\n\r\n|wNotable Figures|n\r\n|W------------------|n\r\n   |wHigh Priest Semaj - The high priest is the leader of House Oroist and is a\r\nhighly respected individual who commands the respect of the people. Some\r\nspeculate his influence is cause for concern to Highborne Sappherion. He can be\r\nlocated at the Great Oroist Temple in the Taloc Sector. |n\r\n\r\n   |wCouncillor Orlu - Orlu no longer serves as a priest or monk for House Oroist\r\nas he hold's House Oroist's seat on the council of Kal Tyor, as it is strictly\r\nforbidden to be a practicing priest or monk while holding such a position. He\r\nspends most of his time in the Kal Tyor chamber. |n\r\n\r\n|wCapital|n\r\n|W------------------|n\r\n   |wHouse Oroist unlike the other houses, does not hold a region or have a\r\ncapital city. Instead, they are based out of the Great Oroist Temple in\r\nTiranoc. Smaller temples can be found in other cities. |n\r\n\r\n|wGuards|n\r\n|W------------------|n\r\n   |wThe Great Oroist Temple's defense comes under the jurisdiction of the\r\nOrdinators, however the House has a sect of warrior monks who devote their lives\r\nto training and defending the temples of Oroist. The honor of watching over\r\nHouse Sereg-Vanma was given to the pious warrior monks of Oroist. |n\r\n\r\n|wHistorical Figures|n\r\n|W------------------|n\r\n   |wThe chief historical figure of House Oroist is Pontius the Wise, a hero of\r\nthe War of Betrayal era. Pontius was the High Priest of House Oroist at the\r\ntime. He was an accomplished warrior who wielded the mace of benevolence, but\r\nhis true strength lay in his power of speech. Always accompanied by the\r\nreligious texts of Konack, Pontius was able to inspire any individual whom he\r\nspoke to. When Pontius gave a sermon, even the most cowardly man became\r\nfearless. Pontius perished at the hands of Hirudegarn, giving his life in an\r\nattempt to delay the beast's advance. |n\r\n", 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 8102, 'key': 'Blue book of Oroist', 'price': 10, 'room_description': 'A copy of the Blue book of Oroist has been dropped here', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_8102', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)]}

legacy_item_8103 = {'color_name': '|cTeal|n book of |bT|Ba|Ce|cs|Ba|bl|n', 'desc': "This is an information guide about House Taesal.\r\n\r\n|wHouse Taesal|n\r\n|W-----------------|n\r\n   |wHouse Taesal is a house formed primarily of merchants, shopkeepers and rich\r\nnobles with too much time on their hands. The house's primary goal is expanding\r\nit's power and influence through enmassing wealth. They are perhaps the most\r\npolitically organised of any of the houses. It was a member of House Taesal who\r\ninvented the concept of a contract on Konack. The House has almost always been\r\nrun by a member of the Taesal family itself. |n\r\n\r\n|wNotable Figures|n\r\n|W-----------------|n\r\n   |wShela Taesal - Currently the matriach of the Taesal family, she is also the\r\nleader of House Taesal. Already quite wealthy, her most notable action of\r\nrecent times was to pass a law that 10% of taxes collected by House Taesal are\r\ngiven to the Taesal family. She can be located at the Taesal Manor in Tiranoc.\r\n\r\n   |wLord Aranni - He is House Taesal's representive on the council of Kal Tyor.\r\nHe owns a large building company that is caters to every area of construction\r\navailable, from small houses right up to government contracts for things such as\r\nroads and so forth. He can be found in his construction company's main office\r\nin Tiranoc. |n\r\n\r\n|wCapital|n\r\n|W-----------------|n\r\n   |wThe capital of House Taesal territory is Machiavila, known as the Merchant\r\nCity. Another area of importantance is the Turlon Fair. |n\r\n\r\n|wGuards|n\r\n|W-----------------|n\r\n   |wHouse Taesal's guard force primarily consists of mercenaries and as such are\r\nnot very loyal to the house. In general, they care very little about the people\r\nthey are protecting beyond fulfilling basic requirements of getting the next\r\npouch of gold. |n\r\n\r\n|wHistorical Figures|n\r\n|W-----------------|n\r\n   |wThe chief historical figure of House Taesal, is a female assassin known as\r\nMeridius and is one of the famous heroes of the War of Betrayal. Although she\r\nwas never actually a member of House Taesal, her parents were. Outside of the\r\nwar she had an almost 100% kill ratio, the only target she ever failed to\r\nassassinate was Eltharion, who she eventually fell in love with. The honorable\r\nguild of assassins was founded by her. |n\r\n", 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 8103, 'key': 'Teal Book of Taesal', 'price': 10, 'room_description': 'A copy of the teal book of Taesal has been left here', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_8103', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)]}

legacy_item_8104 = {'color_name': '|rRed|n book of |rS|Re|rr|Re|rg|x-|CV|ca|Wn|wm|Wa|n', 'desc': 'This book is an information guide on House Sereg-Vanma\r\n\r\n|wHouse Sereg-Vanma|n\r\n|W-----------------|n\r\n   |wKnown as the traitor House, Sereg-Vanma is the reformed house of that which\r\ninstigated the War of Betrayal. All records of the previous name of the House\r\nhave been expunged from records. They are the only House who has no affiliation\r\nwith the religious aspects of Konack, though the warrior monks of House Oroist\r\nhave been appointed to keep an eye on them. |n\r\n\r\n|wNotable Figures|n\r\n|W-----------------|n\r\n   |wLord Nikolish - He is the man who is currently both the leader of House\r\nSereg-Vanma and occupies a seat on the council of Kal Tyor. His best\r\nachievement to date was successfully winning Sereg-Vanma a seat on the Kal Tyor\r\ncouncil. Lord Nikolish is often controversial and has on numerous occassions\r\nstated that he felt the religious House Oroist needed to be made defunct for\r\nKonack to make real progress. Nikolish can be found in the Sereg-Vanma manor in\r\nTiranoc. |n\r\n\r\n   |wLeonardo Da Minci - The foremost inventor and scientist amongst the Konatsu\r\npeople, although the majority of his experiments and inventions are outlawed. \r\nA high ranking member of House Sereg-Vanma, Da Minci hides away in the city of\r\nCerberus. |n\r\n\r\n|wCapital|n\r\n|W-----------------|n\r\n|wThe Capital of the Sereg-Vanma region is the underground city of Cerberus.|n\r\n\r\n|wGuards|n\r\n|W-----------------|n\r\n   |wHouse Sereg-Vanma possesses no guard force to speak of, with the exception of\r\nthe warrior monks of House Oroist assigned to keep an eye on them. Though\r\nrumours suggest that the high ranking members of the house have outlawed\r\nconstructs as their personal guards. |n\r\n\r\n|wHistorical Figures|n\r\n|W-----------------|n\r\n|wNone|n\r\n', 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 8104, 'key': 'Red book of Sereg-Vanma', 'price': 10, 'room_description': 'A copy of Red book of Sereg-Vanma lays here', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_8104', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)]}

legacy_item_8105 = {'color_name': '|YBrown|n book of |rD|Yr|ye|rs|n', 'desc': "This book is an information guide to House Dres.\r\n\r\n|wHouse Dres|n\r\n|W-----------------|n\r\n   |wDres is the House primarily made up of farmers, miners and various other\r\ntrade labourers. It is known as the 'Peoples House' because of this. House\r\nDres also occupies the largest territory of any of it's fellow Houses. Most of\r\nDres' political actions serve the best interests of the common workers and trade\r\nguilds. |n\r\n\r\n|wNotable Figures|n\r\n|W-----------------|n\r\n   |wLord Llaro Stern - The current head of House Dres, Llaro Stern comes from a\r\nlong line of farmers. He rose to power with the support of Matsu Colvian who is\r\nthe head of the most powerful farming family on Konack. Stern likes to get his\r\nhands dirty from time to time as to not forget where he comes from. He can be\r\nfound in his mansion in City Dres. |n\r\n\r\n   |wMishie Shuro - Renowned for her cooking, Mishie is also a high ranking member\r\nof House Dres and their representitive on the Council of Kal Tyor. She has a\r\ngood working relationship with all the trade guilds and is tipped to succeed\r\nLlaro Stern one day as the head of House Dres. Mishie Shuro can be found at the\r\nDres Manor in Tiranoc. |n\r\n\r\n|wCapital|n\r\n|W-----------------|n\r\n|wThe capital of House Dres region is the aptly named rural town, Dres.|n\r\n\r\n|wGuards|n\r\n|W-----------------|n\r\n   |wHouse Dres employs guards in the form of militia. Often young men who desire\r\nanything but to work on their father's farm will pick up a sword and join the\r\nmilitia. While not as organised or as well equipped as the Ordinators of House\r\nIndoril, the Dres Guard make up for it with enthusiasm to do a good job. |n\r\n\r\n|wHistorical Figures|n\r\n|W-----------------|n\r\n   |wThe chief historical figure of House Dres, is Taloc, a giant of a Konatsu\r\nwith as kind a heart as one could fight. Before the War of Betrayal he was but\r\na farm hand. One day, Sereg-Vanma forces attacked the farm he worked at and\r\nTaloc, wielding an axe used for wood chopping, single handidly defeated them. \r\nIt was Pontius the Wise, convinced Taloc to join the war. Along with Pontius,\r\nhe died at the hands of Hirudegarn, in an attempt to delay the beast. |n\r\n", 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 8105, 'key': 'Brown book of Dres', 'price': 10, 'room_description': 'A copy of Brown book of Dres is lying here', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_8105', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)]}

