legacy_item_12609 = {'color_name': '|r[|gDomestic|r]|c Intelligence Report|n', 'item_type': 12, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 12609, 'key': 'paper report domestic intelligence confidential', 'price': 500, 'room_description': '|cAn important piece of paper, with |rconfidential|c written on it, is here|n', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_12609', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)], 'ex_descriptions': [['Satan', "|gSatan City|n\r\n\r\n|wSatan City's mayor has informed us that the city is currently in a deficit,\r\nthis is most visible in that the local hospital is running dangerously low on\r\nmedical supplies. He wanted to make it clear that he was grateful that the\r\nDuel Dome construction project was done in his city but he argues that the\r\ntaxes made from there are simply not enough to assist the struggling city. He\r\nultimately wished to let us know that he needs more money to keep Satan City\r\nfunctional.|n\r\n"], ['WestCity', "|gWest City|n\r\n\r\n|y- |wLocals have expressed a strong interest in seeing more progressive reforms\r\nand bills being passed. As you agreed previously to the suggestion, we have\r\ndismantled the female toilet in King's Castle and moved most stalls and mirrors\r\nto the then male toilet. The progressives responded well to our actions of\r\nhaving a gender-neutral toilet.|n \r\n\r\n|y- |wThe city continues to grow strong economically, if it continues growing at\r\nthis rate then the population will increase and we should expect to get more\r\ncomplaints regarding the earthquakes caused by the mining and explosives in\r\nSilver Mine.|n\r\n"], ['Nexus', "|gNexus City|n\r\n\r\n|wNexus City Mayor has expressed his concerns regarding the large influx of\r\naliens coming into the city as a result of Celestial Corp's Galactic Travels.\r\nHe has admitted that local businesses have greatly benefited from the increased\r\nconsumer base however locals have been sending him letters to do something\r\nabout the increased crime. He was unable to provide any evidence that the\r\naliens were committing these crimes but he strongly believes that they are in\r\nfact responsible. It would be dangerously unwise of this administration to\r\nignore the thoughts and opinions of such a popular politician.|n\r\n"], ['confidential', '|y-|g Nexus|n\r\n|y- |gWestCity|n\r\n|y-|g Satan|n\r\n'], ['paper report domestic intelligence', '\r\n|cThere are reports written on this paper, under |rconfidential|c.|n\r\n']]}

legacy_item_12610 = {'color_name': '|r[|gGalactic|r] |cIntelligence Report|n', 'item_type': 12, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 12610, 'key': 'Galactic Intelligence Paper Report Confidential', 'price': 500, 'room_description': '|cAn important piece of paper, with |rconfidential|c written on it, is here|n', 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_12610', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)], 'ex_descriptions': [['confidential', '|y- |gFrigid|n\r\n|y- |gVegeta|n\r\n|y- |gKonack|n\r\n'], ['Frigid', "|gFrigid|n\r\n\r\n|wReports are coming in from our spies that the World Trade Organization has\r\nabandoned their invasion of Kanassa and sent those troops to Namek. This is\r\nvery worrying as Namek is close to Earth and could be used as a launching point\r\nto invade Earth; we are not sure ourselves on what to do on the matter as the\r\npublic would be extremely angry that Earth's military is assisting the same\r\nrace of people as Piccolo.|n\r\n"], ['Vegeta', '|gVegeta|n\r\n\r\n|wKing Vegeta has sent an embassy, he has made it clear though that he is not\r\ninterested in taking any side in our cold war with Frigid. Advisors think that\r\nthe monarchy is still waiting to see whom will be the winner before they decide\r\nto pursue a friendly relationship. It is for this reason that we suspect that\r\nthe embassy is just a formality and that no actual progress can come between\r\nour two planets.|n\r\n'], ['Konack', '|gKonack|n\r\n\r\n|wThe Konatsus have declined our invitations for us to send a representative and\r\nthey also refused to allow us to send our own to their planet. We doubt that\r\nthey are working with the World Trade Organization and most likely suspect that\r\nthey are just an isolationist people.|n\r\n'], ['Galactic Intelligence Paper Report', '\r\n|cThere are long reports written here under |rconfidential|c.|n\r\n']]}

