legacy_item_14807 = {'color_name': 'Alpha Terminal', 'item_type': 12, 'item_values': [[4, 100], [5, 100], [7, 9]], 'item_vnum': 14807, 'key': 'Alpha Terminal', 'room_description': 'A terminal, codenamed Alpha, has been placed here', 'size': 4, 'weight': 1000, 'prototype_key': 'legacy_item_14807', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'ex_descriptions': [['look alpha terminal', '|rMain Menu|n\r\n|y--------|n\r\n|wExamine Project Alpha|n\r\n|wExamine Antonin|n\r\n|wExamine Log|n\r\n|y--------|n\r\n'], ['examine project alpha', "   |wProject Alpha is the first in a series of living weapons to be used against\r\nthe Saiyans so that our people, the Truffles can once again walk on Planet\r\nPlant. Although it is the first, Alpha Weapon has managed to survive and is\r\nalmost at operational status, despite the failures of many of it's supposed\r\nsuccessors. |n\r\n"], ['examine antonin', '|rAkatsuki Labs Profile|n\r\n|y-----------------------|n\r\n|rName|n: |wAntonin|n\r\n|rAssigned|n: |wPrototype Division|n\r\n|rField|n: |wBiological Warfare|n\r\n|rSecurity Clearance|n: |wA Class|n\r\n|y-----------------------|n\r\n'], ['examine log', "   |wMy name is Antonin, of the Prototypes Division. When I heard that I would be\r\nworking with Doctor Radek, I was over the moon. But since I've been here, he's\r\nbarely been seen. I thought me and Dymtro had the highest level of clearance\r\nbut it seems that Radek is working on something even we have no clue about.\r\n\r\n   I'm starting to have my doubts as to whether there was any point in joining\r\nthis team. If there is another project going on that is being worked on by\r\nRadek himself, then mine and Dymtro's projects are surely redundant! |n\r\n"]]}

legacy_item_14808 = {'color_name': 'Omega Terminal', 'item_type': 12, 'item_values': [[4, 100], [5, 100], [7, 9]], 'item_vnum': 14808, 'key': 'Omega Terminal', 'room_description': 'A terminal, codenamed Omega, has been placed here', 'size': 4, 'weight': 1000, 'prototype_key': 'legacy_item_14808', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'ex_descriptions': [['look omega terminal', '|rMain Menu|n\r\n|y--------|n\r\n|wExamine Project Omega|n\r\n|wExamine Dymtro|n\r\n|wExamine Log|n\r\n|y--------|n\r\n'], ['examine project omega', '   |wProject Omega is the last in the line of Living Weapons to be created by\r\nAtaksuki Labs. It is unrivaled in power and is the most advanced to date. \r\nOmega Weapon will be paired with Alpha Weapon when we deploy them to take back\r\nPlanet Plant from the Saiyans. |n\r\n'], ['examine Dymtro', '|rAkatsuki Labs Profile|n\r\n|y-----------------------|n\r\n|rName|n: |wDymtro|n\r\n|rAssigned|n: |wPrototype Division|n\r\n|rField|n: |wBiological Warfare|n\r\n|rSecurity Clearance|n: |wA Class|n\r\n|y-----------------------|n\r\n'], ['examine log', '   |wI cannot believe it! Who does Doctor Radek think he is? The audacity of the\r\nold fool knows no limits. When I showed him the nearly completed Omega Weapon,\r\nhe merely said, "It is not good enough. A saiyan could create a better thing\r\nthan this." He dares to insult my life work, while he sits in his secret lab\r\ndoing nothing at all!\r\n\r\n   Antonin is a fool and idolises him too much but I am going to have to make a\r\ncomplaint to the big wigs. He is clearly squandering company resources. Or\r\nsomething. I don\'t know! But he is certainly out of line and will pay for this\r\ninjustice. |n\r\n']]}

