legacy_item_15043 = {'color_name': '|YBook |Wof |CA|cq|wu|Bi|bs|n', 'desc': "   |WThis thick book details the beginnings of Kanassa's oldest city, Aquis. \r\nFounded by Lady Aquisa a legendary Kanassan who was said to be the first\r\nkanassan to develope the Hydromancy skill that is sacred to kanassan life. \r\nShe not only developed this but was said to be the kanassan with the strongest\r\nability concerning future sight and prophesied many things concerning her\r\npeople.\r\n\r\n   Aquisa lived on the planet Kanassa twenty two hundred years prior to the\r\nstart of the current year cycle (which happens to be a cycle that starts when\r\nthe Icerian throne first exerted any authority off its own planet. ) Aquisa's\r\nreasons for founding the city Aquis in an underwater cave are not recorded in\r\nthis book and appear to be a closely kept secret among the priests and\r\npriestesses of the temple throughout the centuries.\r\n\r\n   It is known however that the cave the city is located in has been sacred to\r\nkanassans since the beginning of their history and is located in the purest\r\nsection of the large ocean covering most of their planet. A natural fortess it\r\nhas never been breached by enemy or had its location divulged to any enemy who\r\nwould wish to breach it. It now remains the last refuge of their civilization\r\nafter it was nearly wiped out by a war with the WTO a decade ago.\r\n", 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 15043, 'key': 'Book Aquis', 'price': 500, 'room_description': '|WThe |YBook |Wof |CA|cq|wu|Bi|bs|W is lying here|n', 'size': 4, 'weight': 5, 'prototype_key': 'legacy_item_15043', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None), ('hold', 'wear', None)]}

