legacy_item_15606 = {'color_name': "Dread's Journal", 'item_type': 16, 'item_values': [[4, 100], [5, 100], [7, 16]], 'item_vnum': 15606, 'key': 'Dread Journal', 'room_description': "Captain Dread's Journal has been left here", 'size': 4, 'weight': 1, 'prototype_key': 'legacy_item_15606', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)], 'ex_descriptions': [['journal', "   |wYou wouldn't believe how much zenni it cost me to acquire two intact but\r\nunused Hyper Gates! The scientists I hired to get them working for us cost\r\ndamn near as much. A human one insisted that the other Hyper Gates he had\r\nencountered had some programming that prevented anyone not belonging to a\r\nspecific species from using them. Lucky for me, no such case with these. |n\r\n\r\n   |wI've placed one of the gates at our base on Kanassa, the other will be\r\naboard the Kraken. Saves having to try and sneak back onto the planet with our\r\nplunder when we can just get between both places via the Hyper Gate. An\r\ninvestment that will likely pay off a hundred fold in the future. The gates\r\nare linked and require specific symbols pressed in a correct order to work. \r\nI've listed them below, gods only knows I'll never remember them on my own. |n\r\n\r\n|wTo get to our base the |rdial|w sequence is: corvis lepus calum ara hydra orion|n\r\n|wTo get to the Kraken the |rdial|w sequence is: leo hydra pisces grus virgo orion|n\r\n\r\n|rOOC: To use the hypergate, type dial followed by the correct dialing sequence. When enterting the sequence, there are no spaces between the words. Example: dial corviuslepuscalumarahydraorion|n\r\n"], ['dread', '|wTo read the contents of the journal, type: |rlook journal|n\r\n']]}

