legacy_item_63315 = {'color_name': '|nFaceless |RSa|rm|Rael|n Statue|n', 'item_flags': [84], 'item_type': 23, 'item_values': [[0, -1], [1, 100], [2, 15], [4, 100], [5, 100], [7, 8]], 'item_vnum': 63315, 'key': 'faceless statue', 'level': 1, 'price': 1, 'room_description': '|nA faceless statue of a |rm|Ra|rn|n imprisoned stands here|n', 'size': 8, 'weight': 5000000, 'prototype_key': 'legacy_item_63315', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'ex_descriptions': [['vague faceless statue imprisoned samael', "|nThis is a statue as old as time itself, based on the weathered look of the\r\n|xo|nb|xs|ni|xd|ni|xa|nn rock it's carved from. The stone is faded, leaving the man-shaped\r\nstatue left with nothing but vague and faceless features. This man is posed in\r\nthe act of being forced to a knee, or perhaps forcing himself up to one\r\ninstead. Shackles have been locked about the wrists and ankles made from true\r\nKachin, separate from the statue itself. No chains are attached, the dull\r\nmetal etched with primordial sigils instead. This statue dominates the entire\r\natmosphere of this inner sanctum, and mortals who gaze on it can instinctively\r\nhear the name whispering across the soul. The Deceiver. A large kachin |whammer|n\r\nhas been left near the back foot of the statue, added to the statue's ambience\r\nin a way. |n\r\n"], ['hammer', "|nThis large kachin hammer seems like a sculpture at first glance, but in truth\r\nit's the real deal. It looks to have sunken into the base of the statue\r\nsomewhat, the weight of it sinking into the obsidian stone over countless\r\nyears. The hammer itself is a piece of masterwork, a true Blacksmith's work\r\nand is covered in decorative |yscrollwork|n.\r\n"], ['scrollwork', '|w"|yPower isn\'t a weapon but a shield, and the Universe is asunder. This is where\r\nI lay my hammer down, to carry my |cDes|Ct|ciny|n into battle. This is where I return,\r\nto lay my |cDes|Ct|ciny|n to rest. If Peace is the glory you seek, Then carry |cDes|Ct|ciny|n\r\nwith you. |w"|n - Koshou, Eleventh Wielder of the Z-Sword|n\r\n']]}

legacy_item_63316 = {'color_name': '|nConference Table|n', 'item_type': 15, 'item_values': [[0, 1000], [1, 5], [2, -1], [4, 100], [5, 100], [7, 12]], 'item_vnum': 63316, 'key': 'conference table', 'price': 1000, 'room_description': '|nA long, opulent conference table is here|n', 'size': 4, 'weight': 1000, 'prototype_key': 'legacy_item_63316', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'tags': [('take', 'wear', None)], 'ex_descriptions': [['conference table', "|nThis is a large conference table stretching perhaps ten feet from one end to\r\nthe other. It's surrounded by numerous plush leather conference chairs for\r\nclandestine meetings or to discuss business. |n\r\n"]]}

