legacy_item_64336 = {'color_name': '|xO|Wb|xs|Wi|xd|Wi|xa|Wn|Y tablet|n', 'item_type': 8, 'item_values': [[4, 100], [5, 100], [7, 8]], 'item_vnum': 64336, 'key': 'obsidian tablet', 'room_description': '|nAn enormous |xo|Wb|xs|Wi|xd|Wi|xa|Wn|Y tablet|n has been set into the ground', 'size': 8, 'weight': 5000000, 'prototype_key': 'legacy_item_64336', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'ex_descriptions': [['obsidian tablet', "|w(-/------------------------------------------------------\\-)|n\r\n|xIn the height of the Age that came before, there grew out of the shadows a\r\nmighty Empire. This Empire was lead by a furious leader, a man of harsh value\r\nand harsh life. His Empire rose to great heights, stretching across worlds and\r\neven in the beginning there were the aspirations of stretching across the\r\nentire Galaxy. As the Empire grew large, the people in it grew secure and safe\r\nin the knowledge that they belonged to the First Empire and that they would\r\nlive lives of prosperity and wealth. Volunteers from every world flcoked to\r\njoin the Empire's Militia, to give to the Great Cause. \r\n|X    |n\r\nThe world of Kesh was known even then. A harsh people who thrived upon a harsh\r\nworld, great warriors to help bolster the arm of the Empire and for many years\r\nthere were lauded as the best of warriors. Elite. However, soon there would\r\nbe catastrophe that would ravage and entire galaxy and shake the empite to its\r\nknees.\r\n|w(-/------------------------------------------------------\\-)|n\r\n"]]}

legacy_item_64337 = {'color_name': '|wI|Wv|wo|Wr|wy|Y tablet|n', 'item_type': 8, 'item_values': [[4, 100], [5, 100], [7, 26]], 'item_vnum': 64337, 'key': 'ivory tablet', 'room_description': '|nAn enormous |wi|Wv|wo|Wr|wy|Y tablet|n has been set into the ground', 'size': 8, 'weight': 5000000, 'prototype_key': 'legacy_item_64337', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'ex_descriptions': [['ivory tablet', '|w(-/------------------------------------------------------\\-)|n\r\n|wThe Catasrophe came from out of the stars like fire. He wreaked havoc across\r\nthe entire Galaxy, and it seemed it would be the signaling of the end of an\r\nAge. His wrath and insanity bore great destruction down upon the Empire. \r\nStars, planets, entire systems destroyed from the sky as if they never were. \r\nRumors of the "|ySuper Saiyan|w" floated from world to world in tones of horror and\r\npanic. As the fall of the Vidar grew into a certainty, a coalition of people\r\nchose to gather the resourses they could and depart from their worlds, in\r\nsearch of another. A convoy of space craft that would attempt to traverse\r\nthrough the depths of deep space and find their way to a Galaxy not doomed to\r\nfall under the might of the Star Killer. |n\r\n|X      |n\r\n|wThere would be no promised land for these ships. As they began to drift into\r\nthe dark reaches, there were problems and a betrayal from within. \r\nInfiltrators, agents of the Empire desperate to find enough soldiers to defeat\r\nStar Killer who sabotaged the journey. The ships were forced to turn back, and\r\nthough they would liberate themselves once more it would be too late. There\r\nwas no escape for them, instead returning to Kesh was the only world within\r\nreach. Kesh had long since been nearly abandoned as the peoples there had\r\nmoved inward toward the glory of the Empire. Those of us who came from this\r\nworld, or were descended from those who\'d lived here were chosen to lead for\r\nthe time it would take to scavange potential fuel or seek another way to\r\nsurvive the coming end of their Galaxy. |n\r\n|w(-/------------------------------------------------------\\-)|n\r\n']]}

legacy_item_64338 = {'color_name': '|xO|Rn|xy|Rx|Y tablet|n', 'item_type': 8, 'item_values': [[4, 100], [5, 100], [7, 25]], 'item_vnum': 64338, 'key': 'onyx tablet', 'room_description': '|nAn enormous |xo|Rn|xy|Rx|Y tablet|n has been set into the ground', 'size': 8, 'weight': 5000000, 'prototype_key': 'legacy_item_64338', 'prototype_parent': 'formless_item', 'prototype_tags': ['legacy_item', 'legacy'], 'ex_descriptions': [['onyx tablet', '|w(-/------------------------------------------------------\\-)|n\r\n|RThe land was harsher than those native would remember, but to them it was like\r\na challenge renewed. Those who were new to the cruel living of the desert\r\nwithered under its oppression but the peoples that had made it here banded\r\ntogether. Those that flourished help shade those that did not, and together\r\nthat carved out a temporary life. One that became more and more permanant as\r\nsearch for fuel and alternatives amounted to nothing. Slowly but surely, one\r\nship would be selected to build infrastructure or to bolster resources when\r\nthere were none. And then another, and another. As the generations passed, it\r\nbecame clear that they had after all found their answer. The rest of the\r\nGalaxy gone, the ravaging of the Star Killer left only bones and what remained\r\nfled to the true core of the Empire, and the Gate they had come from. The Gate\r\nthey had guarded like a holy relic. He destroyed it, all the same and the\r\nrupture that it caused sent a shockwave that reached even this world, at the\r\nouter rim. |n\r\n|X       |n\r\n|RKesh has become an even harsher world, to punish us. Skies of fire and\r\nlightning, rain like acid to fall from black clouds. After all the generations\r\nthat have come before, he found us at long last. The last remains of his\r\norigin. We believe there is nothing left of the Empire, nothing left of the\r\nGalaxy. Somehow, this world continues ot persist among the chaos, and somehow\r\nwe continue to survive. When he is close we can feel the shake of his power,\r\nbut he does not descend his wrath down upon us. Many of the last of us have\r\nbegun to worship him as a God. I have seen visages of him, looking down upon\r\nthe ruined yet living remains of this world with scorn and pity, never mercy.\r\nI worry for my son, the Division comes soon, and we must be ready. We must live\r\non. |n\r\n\r\n|w(-/------------------------------------------------------\\-)|n\r\n']]}

